aboutText:
Myself 
Originally hail from Darbhanga(Bihar);
Have done MBA from IRMA, Gujarat in 2006;
Worked for Canara Bank, Bangalore as Manager for two years, then for Birla Sun life Insurance, Varanasi for next two years;
Currently with IL & FS as Project Consultant (Finance),Patna.    
I try to respond situations with a positive and calm mind;
Love reading books and travelling to different places in order to learn more and more out of the people and world around;
Have three sisters all younger than me, (one married);Parents mostly living in Darbhanga but keep frequenting me in Patna;
